import React from 'react'
import styles from '../Styles/Wesushi.module.css'
import clsx from 'clsx';
import { useEffect, useState } from 'react';
function Item() {
    const [data, setdata] = useState([])
    useEffect(() => {
        fetch("https://testapi.io/api/HoangHuy/https://testapi.io/api/HoangHuy/Wesushi")
            .then((courses) => {
                return courses.json();
            })
            .then((posts) => {
                return setdata(posts)
            })
    }, [])
    return (
        <div className="item">
            {data.map(data => (
                <div>
                    <div className="Wesushi_img">
                        <img className={clsx(styles.Wesushi_img)} src={data.url} alt="img"></img>
                    </div>
                    <div className="title">
                        <h1 className="title">Sushi Gift Box</h1>
                    </div>
                    <div className="price">
                        <h1 className="price">528.000Ä‘</h1>
                    </div>
                </div>
            ))}
        </div>
    )
}

export default Item;
